import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';


const App: React.FC = () =>{

  return(
    <Routes>
      <Route path="/" element={<div>Page-1</div>}/>
      <Route path="/1" element={<div>Page-2</div>}/>
    </Routes>
  )
}

export default App;
